import React from 'react'
import CartItem from './CartItem'

export default function CartList({value}) {
    console.log(value); 
    const {cart} = value; 
    console.log(cart); 
    return (
        <div className="container-fluid">
            {value.cart.i}
            <CartItem/>
        </div>
    )
}
